import React from 'react';

export default () => {
    return (
        <div>
            <div className="message">
                <span className="message-title">Chat message</span>
                <ul style={{padding : '0', margin: '0'}}>
                    <li>Hello</li>
                    <li>Nina</li>
                    <li>Cursor</li>
                </ul>
            </div>
        </div>
    )
}
